// src/TeamMemberCard.tsx
import React from 'react';

interface TeamMember {
  name: string;
  image: string;
  teams: string;
  blurb: string;
}

const TeamMemberCard: React.FC<TeamMember> = ({ member }) => {
  return (
    <div className="team-member-card">
      <div className="info-column">
        <h2>{member.name}</h2>
        <p className="teams">{member.teams}</p>
        <p className="blurb">{member.blurb}</p>
      </div>
      <div className="image-column">
        <img src={member.image} alt={member.name} style={{ maxWidth: 300, maxHeight: 400 }} />
      </div>
    </div>
  );
};

export default TeamMemberCard;
